    padding : 24px 24px 0 24px;
    .slide-icon {
      position: absolute;
      top: 0;
      display: flex;
      align-items: center;
      background: #0A172B;
      height: 100%;
    }
    .slide-icon.right {
      right: 0px;
    }

    .slide-icon.left {
      left: 0px;
    }
